import React from 'react'; 
import './Square.css';
import Piece from '../Piece/Piece';

const Square = ({row, column, background, piece, onClick, pieceClick}) => {
	let classes = 'square '+background;
	let position = [column, row];
	let returnThis = piece 
	? 	<div className={classes} data-row={row} 
		// onClick={onClick} 
		data-column={column}> 
		<Piece position={position} onClick={pieceClick} type={piece[0]} color={piece[1]} /> </div>
	: <div className={classes} data-row={row} onClick={onClick} data-column={column} />;
	return returnThis; 
}

export default Square;
